def func(a=10, b=20, c=30):
    pass

# Valid
func(a=11, b=21, c=31)
func(b=11, a=21, c=31)
func(c=11, a=21, b=31)
func(a=11, b=31, **{"c": 41})
func(a=11, **{"b": 21}, **{"c": 41})
func(a=11, **{"b": 21, "c": 41})
func(**{"b": 21, "c": 41})
func(**{"a": 11}, **{"b": 21}, **{"c": 41})
func(**{"a": 11, "b": 21, "c": 41})

# Invalid
func(a=11, c=31, **{"c": 41})
func(a=11, c=31, **{"c": 41, "a": 51})
func(a=11, b=21, c=31, **{"b": 22, "c": 41, "a": 51})
func(a=11, b=21, **{"c": 31}, **{"c": 32})
func(a=11, b=21, **{"c": 31, "c": 32})
